      SELECT ALL - col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) > ( - col0 + col2 * + ( - CAST ( + 10 AS INTEGER ) ) * ( - col0 ) + 23 / ( 79 + - col1 / 25 ) );
  - name: tab0

outputs:
  - name: q5110.out
    data: |
